import React from "react";
import '../components/Navbar.css';

function Navbar(){
    return (
            <ul>
                <li><a href="#">Home</a></li>
                <li><a>About Me</a></li>
                <li><a>Projects</a></li>
                <li><a>Contact Me</a></li>
            </ul>
    )
}

export default Navbar;
